import React from 'react';
import { Table } from 'antd';

const columns = [
    {
      title: 'Nombre',
      dataIndex: 'name',
    },
    {
      title: 'Edad',
      dataIndex: 'age',
    },
    {
      title: 'Dirección',
      dataIndex: 'address',
    },
  ];

const CustomTable = (props) => {
    const {data} = props;
    return (
    <Table columns={columns} dataSource={data} pagination={false}/>
    );
};

export default CustomTable;
